# The 6 variants of payloads obtained from the 500 HTTP streams
payload = ["",
           "",
           "",
           "",
           "",
           ""]

for x in payload:
    decpayload = []
    for i in range(0, len(x), 2):
        decval = int(x[i:i+2],16)
        decval = decval - int(i/2)
        if decval>=0:
            decpayload.append(chr(decval))
        else:
            break
    # print(decpayload)
    print(''.join(decpayload))